const home ='http://127.0.0.1:8000/';
const login ='http://localhost:8000/token-auth/';
const apiV1 ='http://127.0.0.1:8000/api/v1/';
const posts ='http://127.0.0.1:8000/api/v1/users/posts/';
const signup ='http://127.0.0.1:8000/api/v1/rest-auth/registration/';
const userlist='http://127.0.0.1:8000/api/v1/users/';

export default {
    home,
    login,
    apiV1,
    posts,
    signup,
    userlist,
};
